import Link from "next/link";

const NavLink = ({ href, title }) => (
  <Link href={href}>
    <a>{title}</a>
  </Link>
);

const NavBar = () => {
  return (
    <div className="bg-gray-500 py-4">
      <NavLink href="/sobre" title="Sobre" />
      <NavLink href="/cadastro" title="Cadastro" />
      <NavLink href="/entrar" title="Entrar" />
    </div>
  );
};

export default NavBar;
